    /**
     * Stores the same values as the first element in {@link #TILE_NOISE} if considered [x][y] indexed; available for
     * convenient usage by code that uses 2D byte arrays.
     */
    private static final byte[][] RAW_2D = new byte[64][64];

    static {
        for (int x = 0; x < 64; x++) {
            System.arraycopy(TILE_NOISE[0], x << 6, RAW_2D[x], 0, 64);
        }
    }

    /**
     * Gets a point in a potentially-infinite aperiodically-tiling plane of blue noise, where each 64x64 square of blue
     * noise is drawn from {@link #TILE_NOISE}. Because each square of TILE_NOISE can tile with any other from that
     * group, this can choose those squares randomly, and it does so using a simplistic (and fast) hash based on
     * Cantor's pairing function. Unlike earlier attempts here to make aperiodic tilings of blue noise, this makes
     * high-quality blue noise that satisfies the progressive quality.
     * <br>
     * <a href="https://i.imgur.com/VZyuAAn.png">Blue noise at left, magnitude histogram at right.</a>
     *
     * @param x    x coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param y    y coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @return a byte obeying a blue noise distribution
     */
    public byte get(int x, int y) {
        int a = x >>> 6 ^ seed >>> 6;
        int b = y >>> 6 ^ seed >>> 12;
        return TILE_NOISE[(seed + b + ((a + b) * (a + b + 1) >> 1)) & 63][(y << 6 & 0xFC0) | (x & 0x3F)];
    }
